import React from "react";

const Navbar = () => {
  return (
    <div>
      <nav className="navbar navbar-light bg-light">
        <a href="/" className="navbar-brand">
          <img
            src="https://1.bp.blogspot.com/-iNjPFmg17jM/XcsN0KcmO3I/AAAAAAAAdHA/jkFo0C47MWMiNJui3CGjifcnrLUSyl11QCNcBGAsYHQ/s1600/Blood%2BBank.jpg"
            width="120"
            height="60"
            className="d-inline-block align-top"
            alt=""
          />
          Blood-Bank-App
        </a>
      </nav>
    </div>
  );
};

export default Navbar;
